css:
#grand {
    width:100%;
    height:300px;
    object-fit: cover;
}

.box {
    display: flex;
    width:100%;
}
.mini {
    width:calc(100% / 4);
    height:160px;
    object-fit: cover;
}

js:
// sélectionnr la liste des miniatures
var tabMini = document.querySelectorAll(".mini");
// pour chaque image miniature on ajoute un Event Listener
for(mini of tabMini)
{
    mini.addEventListener("click", function(){
       // ce code sera active quand la miniature sera cliquée
       // on copie l'attribut src de l'image miniature sur l'image en grand
       grand.src = this.src;     
    });
}
